    [],nt"num_tags": 3,nt"name": "back-bay-national-wildlife-refuge-refuge-narrative-report-may-august-1947",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Back Bay NWR
    outlines Refuge accomplishments from May through August of 1947. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, and violations. N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
